import React, { useState } from "react";
import "./Auth.css";
import { useNavigate } from "react-router-dom";

const Login = () => {
  const [formData, setFormData] = useState({ emailOrPhone: "", password: "" });
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch("http://localhost:5000/api/auth/login", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      const data = await res.json();
      console.log("Login Response:", data);

      if (res.ok) {
        alert("‚úÖ Login successful!");

        // Extract user safely
        const user = data.user || data; 
        const userId = user._id;
        const role = user.role;

        // ‚úÖ Save info to localStorage
        if (userId) localStorage.setItem("userId", userId);
        if (role) localStorage.setItem("role", role);

        // ‚úÖ Navigate based on role
        if (role === "Student") {
          navigate("/studentprofile");
        } else if (role === "Admin") {
          navigate("/admin-profile");
        } else {
          alert("‚ö†Ô∏è Unknown role. Please contact admin.");
        }
      } else {
        alert("‚ö†Ô∏è " + (data.error || "Invalid credentials"));
      }
    } catch (err) {
      console.error("‚ùå Error logging in:", err);
      alert("‚ùå Failed to connect to server");
    }
  };

  return (
    <div className="auth-container">
      <h2>üîë Login</h2>
      <form onSubmit={handleSubmit} className="auth-form">
        <div className="form-group full-width">
          <label>Email / Phone</label>
          <input
            type="text"
            name="emailOrPhone"
            value={formData.emailOrPhone}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group full-width">
          <label>Password</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-actions">
          <button type="submit">Login</button>
        </div>

        <p className="auth-links">
          <a href="/ForgotPassword">Forgot Password?</a> <br />
          Don't have an account? <a href="/Signup">Create Account</a>
        </p>
      </form>
    </div>
  );
};

export default Login;
